import Icon from "../../../components/Icon/Icon";
import { GlobalThemes } from "../../../ThemeManager";
import "./SalesTheme.scss";
const SalesTheme = ({}: {}) => {
  return (
    <>
      <div className="background">
        <Icon icon="SalesBackground" viewBox="0 0 500 500" />
      </div>
      <div className={"salesContainer "}>
        <div className="header">
          {/*<div className="left ">
            <Icon icon="Diamond" />
            <span className="headline six textPrimary">Account</span>
  </div>*/}
          <div className="titleContainer">
            <div className="headline one candy">Candy</div>
            <div className="headline one shop">Shop</div>
            <div className="headline two">Bringing you more candy!</div>
            <a className="designButton funButton">Get Candy!</a>
          </div>
        </div>
      </div>
    </>
  );
};
export default SalesTheme;
